// Importações
import styles from './Home.module.css'

function Home() {
    return(
        <section>
            <h1>Bem-vindo(a) ao <span>Duots</span></h1>
            <p>Somos a melhor ferramenta para gerenciar os seus projetos!</p>
            <a href="/">Come</a>
        </section>
    )
}

export default Home
